import React from 'react';

function card(props) {
   let info=props.info;

  return (
    <div>
        <div>
            <img src={info.image} alt={info.id} width="30px" height="30px" ></img>
        </div>
        <div>
            {info.name};
        </div>
        <div>
            {info.job}
        </div>
        <div>
            {info.text}
        </div>
    </div>
  )
}

export default card
